import React from 'react';
import {Link} from "react-router-dom";
const MangaItem = () => {
  return (
    <div
      className="card item-manga col-6 col-md-4 col-lg-3"
      style={"width: 10rem"}
    >
      <div className="img-manga">
        <img className="card-img-top" src="../../public/Uploads/manga/1.png" alt=""/>
      </div>
      <div className="card-body item-manga-content">
        <Link to="/" className="title-manga">
          <p className="card-text">Boku Girl Boku Girl</p>
        </Link>
        <p className="price-manga">35.000</p>
      </div>
    </div>
  );
};

export default MangaItem;
